import GeneralInfo from './components/GeneralInfo';
import Header from './components/Header';
import ContactInfo from './components/ContactInfo';
import './App.css';

class App extends Component {
  constructor() {
    super();

  }
  render() {

    return (
      <div>
        <Header firstName="First Name" lastName = "Last Name" currentRole ="Current Role"/>
        <ContactInfo addressOne="Address 1" addressTwo="AddressTwo" phone="Phone" email="Email" linkedin="linkedin" />

        <GeneralInfo button="+ Work Experience" title = "Experience"/>
        <GeneralInfo button="+ Education" title = "Education"/>
        <GeneralInfo button="+ Skills" title = "Skills"/>
      </div>
    );
  }
}

export default App;
